Biography
THE PROPHECY are a Progressive Doom Metal band from Yorkshire England. Over the last 10 years, The Prophecy have released three studio albums, Ashes, Revelations and Into The Light. The band have performed worldwide and are renowned in the underground for their live performances. The band have supported, among others, MY DYING BRIDE, NOVEMBRE, MOURNING BELOVETH, ESOTERIC, REVEREND BIZZARE, SATURNUS, JACK FROST and have performed at a number of metal festivals, including Bloodstock, Day of Darkness, Dutch Doom Days, Moscow Doom Festival, Brutalfest, and Midifest.
